import React from "react";
import "./machineHomeStyles.scss";

const AllMachines = () => {
  const arrToMap = [
    {
      id: "2",
      type: "truck",
      model: "320d",
      img:
        "data:image/jpeg;base64,",
    },
    {
      id: "3",
      type: "skid",
      model: "299d",
      img:
        "data:image/jpeg;base64,",
    },
    {
      id: "24",
      type: "dozer",
      model: "d6",
      img:
        "data:image/jpeg;base64,",
    },
    {
      id: "2203",
      type: "tractor",
      model: "938g",
      img:
        "data:image/jpeg;base64,",
    },
    {
      id: "20",
      type: "tractor",
      model: "938m",
      img:
        "data:image/jpeg;base64,",
    },
    {
      id: "229",
      type: "tractor",
      model: "320d",
      img:
        "data:image/jpeg;base64,",
    },
    {
      id: "2230",
      type: "tractor",
      model: "305.5",
      img:
        "data:image/jpeg;base64,",
    },
    {
      id: "220",
      type: "tractor",
      model: "140h",
      img:
        "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTizENAsz0EOXFnRCx2pioWg2OhHuKGkumGXA&usqp=CAU",
    },
  ];

  return (
    <div className="allMachines">
      {arrToMap.map((item) => {
        return (
          <div
            className="machine-card"
            key={item.id}
            style={{
              backgroundImage: `url(${item.img})`,
            }}>
            <div className="bottomBtns">
              <button className="serviceBtn">Service</button>
              <button className="inspectionBtn">Inspection</button>
            </div>
          </div>
        );
      })}
    </div>
  );
};

export default AllMachines;
